CREATE TABLE IF NOT EXISTS "DIMENSIONS"."AIRPORTS"
(
   CODE varchar(3) PRIMARY KEY NOT NULL,
   NAME varchar(100),
   CITY varchar(100),
   STATE varchar(2),
   COUNTRY varchar(50),
   LATITUDE decimal(65535,32767),
   LONGITUDE decimal(65535,32767),
   CITY_ABR varchar(20)
)
;
CREATE UNIQUE INDEX IF NOT EXISTS PRIMARY_KEY_34 ON "DIMENSIONS"."AIRPORTS"(CODE)
;


